('2207','23','6062','Gästehaus Amena-Mar',Null,'Gepflegtes Gästehaus in 1. Meereslinie an der Ostküste Mallorcas','31322','In der Nähe von Cala Millor, direkt in der 1. Meereslinie und an der Uferpromenade gelegen, steht dieses gepflegte Gästehaus. Es ist aufgeteilt in 15 Doppelzimmer, Studios und Suiten, fast alle mit tollem Meerblick.\r\n4 Dopplzi., seitlichen Meerblick\r\n2 Studios ohne Meerblick, hof\r\n2 Studios mit Meerblick  \r\n4 Apartments mit Meerblick  (alle mit Wohnzi., Schlafzim., Bad, Kitchinette und Meerblick).  \r\n3 Suiten mit Meerblick.\r\n(1  Familienzimmer mit Meerblick, wenn 2 Suiten zusammen gelegt werden)\r\nIm Gästehaus befindet sich außerdem noch ein Restaurant.\r\nFür weitere Details kontaktieren Sie bitte unser Büro.\r\n','31323','1100000','106','2014-05-06 11:12:28','110','2014-05-06 11:12:36',Null,'2161','1','1021',1,'1','0',Null,Null,Null,'31324',Null,'0','0','0',Null,'2016-02-23 08:56:22',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31325',Null,'31326',Null,'31327',Null,'31328','Mobil  615 519 261 Frau Kasper','31329','0',0,'0');
